import React, { useState, useEffect } from 'react';
import diamondBlock from './diamondBlock.png'
import diamondSword from './diamondSword.png'
import diamondPickaxe from './diamondPickaxe.png'

const Shop = () => {

  const [items, setItems] = useState([
    {name: "Diamond Block",
    price: "10 MineDollars", 
    img: diamondBlock,
    id: "db"}, 
    {name: "Diamond Sword",
    price: "5 MineDollars", 
    img: diamondSword ,
    id: "ds"}, 
    {name: "Diamond Pickaxe",
    price: "6 MineDollars", 
    img: diamondPickaxe,
    id: "dp"}, 
  ]);





    return (
        <div>
          <div className="barCart">
            <div className="cartSection">Cart</div>
          </div>
          <h1 className="shopTitle">Shop</h1>
           <div className="itemsSection">
           {items.map(function(d, idx){
         return (<li key={idx}>{d.name}</li>)
       })}
           </div>
        </div>
      );
    };

    export default Shop;
